import {useState} from 'react';
import axios from 'axios';
import {Link} from 'react-router-dom';
import About from './pages/About';
import Contact from './pages/Contact';
import {BrowserRouter as Router} from 'react-router-dom';
import {Routes as Routes} from 'react-router-dom';
import {Route as Route} from 'react-router-dom';
import styles from './mystyles.module.css'

function Home(){
  const [stvar, setMess] = useState('');
  const handleClick = () => {
    axios.get('http://localhost:8080/helphealth12')
    .then(response => setMess(response.data))
  }
  const linksData = [
    { id: 1, text: 'About', to: '/about' },
    { id: 2, text: 'Contact', to: '/contact' },
    ];
    return(
    <Router>
      <div>
        <Routes>
          <Route path="/about" element={<About name = {stvar}/>} />
          <Route path="/contact" element={<Contact name = {stvar}/>} />
        </Routes>
        <h1>Welcome to localhost:3000</h1>
        <p>You are currently communicating with localhost:8080.</p>
        <nav>
            <ul>
                {linksData.map((link) => (
                <li key={link.id}>
                    <Link to={link.to} onClick = {handleClick}>{link.text}</Link>
                </li>
                ))}
            </ul>
        </nav>
      </div>
    </Router>
    )
}

export default Home;
